import LoginForm from '../components/auth/LoginForm';
import RegisterForm from '../components/auth/RegisterForm';

const Auth = ({ authRoute }) => {
	let body;
	body = (
    <div>
      {authRoute === "login" && <LoginForm />}
      {authRoute === "register" && <RegisterForm />}
    </div>
  );
	return (
		<div>
			{authRoute === 'login' && <LoginForm />}
			{authRoute === 'register' && <RegisterForm />}

		</div>
	);
};

export default Auth;
